function I = fcnK5C(S, t, u, alpha, F, tol)
t2 = F .^ 2;t5 = sqrt(t2 .* S + u);t8 = S .* alpha;t9 = -t8 + u;t10 = 0.1e1 ./ t9;t11 = t10 .* alpha;t12 = sqrt(-alpha);t13 = F - t12;t14 = t13 .^ 2;t16 = t12 .* S;t17 = t13 .* t16;t20 = sqrt(t14 .* S + 0.2e1 .* t17 - t8 + u);t21 = 0.1e1 ./ t20;t23 = t12 .* alpha;t24 = t10 .* t23;t25 = 0.1e1 ./ u;t27 = F .* S;t31 = sqrt(t9);t34 = 0.1e1 ./ t31 ./ t9 .* alpha;t37 = 0.1e1 ./ t13;t39 = log(0.2e1 .* t37 .* (t20 .* t31 + t17 - t8 + u));t41 = F + t12;t42 = t41 .^ 2;t44 = t41 .* t16;t47 = sqrt(t42 .* S - 0.2e1 .* t44 - t8 + u);t48 = 0.1e1 ./ t47;t56 = 0.1e1 ./ t41;t58 = log(0.2e1 .* t56 .* (t47 .* t31 - t44 - t8 + u));t64 = alpha .^ 2;t65 = S .* t64;t66 = t9 .^ 2;t67 = 0.1e1 ./ t66;t72 = S .^ 2;t73 = t72 .* t12 .* t64;t74 = t25 .* t67;t80 = 0.1e1 ./ t31 ./ t66;t98 = -0.1e1 ./ t5 ./ S - t21 .* t11 + 0.3e1 ./ 0.2e1 .* t27 .* t21 .* t25 .* t24 + t39 .* t34 - t48 .* t11 - 0.3e1 ./ 0.2e1 .* t27 .* t48 .* t25 .* t24 + t58 .* t34 + t21 .* t37 .* t10 .* t23 ./ 0.4e1 - 0.3e1 ./ 0.4e1 .* t21 .* t67 .* t65 + 0.3e1 ./ 0.4e1 .* F .* t21 .* t74 .* t73 + 0.3e1 ./ 0.4e1 .* t39 .* t80 .* t65 - t48 .* t56 .* t10 .* t23 ./ 0.4e1 - 0.3e1 ./ 0.4e1 .* t48 .* t67 .* t65 - 0.3e1 ./ 0.4e1 .* F .* t48 .* t74 .* t73 + 0.3e1 ./ 0.4e1 .* t58 .* t80 .* t65;
